p;amp;quot; style=&amp;amp;amp;amp;amp;quot;float: right; margin-right: 250px&amp;amp;amp;amp;amp;quot;&amp;amp;amp;amp;amp;gt;\r\n                &amp;amp;amp;amp;amp;lt;/div&amp;amp;amp;amp;amp;gt;\r\n                &amp;amp;amp;amp;amp;lt;p class=&amp;amp;amp;amp;amp;quot;desc&amp;amp;amp;amp;amp;quot;&amp;amp;amp;amp;amp;gt;\r\n                    The Abraj Al-Bait is a government-owned complex of seven skyscraper hotels in Mecca, Saudi Arabia. These towers are a part of the King Abdulaziz Endowment Project that aims to modernize the city in catering to its pilgrims. The central hotel tower, the Makkah Clock Royal Tower, has the world            ', 1),
(9, 'finance_centre', '\r\n<body>\r\n    <div id=\"con\">\r\n        <div id=\"content\"> \r\n\r\n            <div class=\"containter\">\r\n                <h2 class=\"title_khalif\">Ping An International Finance Centre</h2>\r\n                <div class=\"topleft\">\r\n                    <div class=\"dropdown\">\r\n                        <button class=\"dropbtn\">More info</button>\r\n                        <div class=\"dropdown-content\">\r\n                            <a href=\"?idp=\">Main Page</a>\r\n                            <a href=\"?idp=khalifa\">Burj Khalifa</a>\r\n                            <a href=\"?idp=shanghai\">Shanghai Tower</a>\r\n                            <a href=\"?idp=al_bait\">Abraj Al-Bait Clock Tower</a>\r\n                            <a href=\"?idp=world_tower\">Lotte World Tower</a>\r\n                            <a href=\"?idp=videos\">Drone footage</a>\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n            \r\n        \r\n            <div style=\"height:auto; text-align:justify;\">\r\n                <div class=\"left_side\" style=\"margin-right:10px;\">\r\n                    <img src=\"resources/Pingan_International_Finance_Center2020.jpg\" style=\"float: left; margin-left: 30px;\">\r\n                </div>\r\n                <div class=\"right_side\" style=\"margin-left:10px;\">\r\n                    <img src=\"resources/240px2019-12-23.jpg\" style=\"float: right; margin-right: 250px\">\r\n                </div>\r\n                <p class=\"desc\">\r\n                    The Ping An International Finance Center (also known as the Ping An IFC) (Chinese: 平安国际金融中心) is a 115-story, 599 m (1,965 ft) supertall skyscraper in Shenzhen, Guangdong, China. The building was commissioned by Ping An Insurance and designed by the American architectural firm Kohn Pedersen Fox Associates. It was completed in 2017,[1] becoming the tallest building in Shenzhen, the 2nd tallest building in China and the 4th tallest building in the world. It also broke the record of having the highest observation deck in a building at 562 m (1,844 ft).\r\n                </p>\r\n                <p class=\"desc\">\r\n                    The building is located within the Central Business District of Shenzhen in Futian. Its 18,931 square meter lot was purchased by Ping An Group via auction at a price of 1.6568 billion RMB on 6 November 2007. Design of the building began in 2008 with Kohn Pedersen Fox Associates providing the architectural design and Thornton Tomasetti providing structural design. Its foundation stone was laid on 29 August 2009, and construction started in November the same year. China Construction First Building Group was hired as the general contractor to construct the building.\r\n\r\n                    On 15 March 2013, the construction process was temporarily halted, due to the suspected use of concrete made with unprocessed sea sand, which could corrode the steel structure. Construction resumed on the building after sample testing.\r\n                </p>\r\n                <p class=\"desc\">\r\n                    The building topped out on 30 April 2015, and became the second tallest skyscraper in China at a height of 599 meters. The original plan was to add a 60-meter-long antenna atop the building to surpass the Shanghai Tower and become the tallest building in China. However, in February 2015, it was decided that the antenna would not top the tower due to the possibility that it might obstruct flight paths\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>    \r\n</body>\r\n', 1),
(10, 'khalifa', ' &lt;body&gt;\r\n    &lt;div id=&quot;con&quot;&gt;\r\n        &lt;div id=&quot;content&quot;&gt; \r\n\r\n            &lt;div class=&quot;containter&quot;&gt;\r\n                &lt;h2 class=&quot;title_khalif&quot;&gt;Burj Khalifa the biggest of them all&lt;/h2&gt;\r\n                &lt;div class=&quot;topleft&quot;&gt;\r\n                    &lt;div class=&quot;dropdown&quot;&gt;\r\n                        &lt;button class=&quot;dropbtn&quot;&gt;More info&lt;/button&gt;\r\n                        &lt;div class=&quot;dropdown-content&quot;&gt;\r\n                            &lt;a href=&quot;?idp=&quot;&gt;Main Page&lt;/a&gt;\r\n                            &lt;a href=&quot;?idp=shanghai&quot;&gt;Shanghai Tower&lt;/a&gt;\r\n                            &lt;a href=&quot;?idp=al_bait&quot;&gt;Abraj Al-Bait Clock Tower&lt;/a&gt;\r\n                            &lt;a href=&quot;?idp=finance_centre&quot;&gt;Ping An International Finance Centr&lt;/a&gt;\r\n                            &lt;a href=&quot;?idp=world_tower&quot;&gt;Lotte World Tower&lt;/a&gt;\r\n                            &lt;a href=&quot;?idp=videos&quot;&gt;Drone footage&lt;/a&gt;\r\n                        &lt;/div&gt;\r\n                    &lt;/div&gt;\r\n                &lt;/div&gt;\r\n            &lt;/div&gt;\r\n            \r\n        \r\n            &lt;div style=&quot;height:auto; text-align:justify;&quot;&gt;\r\n                \r\n                &lt;div  class=&quot;left_side&quot; style=&quot;margin-right:10px;position: relative;&quot;&gt;\r\n                    &lt;button id=&quot;onPressEnlarge&quot; style=&quot;float:left; margin-left: 30px; position: absolute;&quot;&gt;zoom in&lt;/button&gt;\r\n                    &lt;button id=&quot;onPressShrink&quot; style=&quot;float:left; margin-left: 110px; position: absolute;&quot;&gt;zoom out&lt;/button&gt;\r\n                    &lt;img id=&quot;kalifa_1&quot; src=&quot;resources/137px-Burj_Khalifa.jpg&quot; style=&quot;float: left; margin-left: 30px; width: 150px; height: 300px;&quot;&gt;\r\n                &lt;/div&gt;\r\n\r\n                &lt;div  class=&quot;right_side&quot; style=&quot;margin-left:10px; position:relative&quot;&gt;\r\n                    &lt;img id=&quot;onMouseOverEnlarge&quot; src=&quot;resources/240px-Burj_Khalifa.jpg&quot; style=&quot;float: right; margin-right: 250px; width: 150px; height: 300px;&quot;&gt;\r\n                &lt;/div&gt;\r\n                &lt;p class=&quot;desc&quot;&gt;\r\n                    The Burj Khalifa\r\n                    known as the Burj Dubai prior to its inauguration in 2010, is a skyscraper in Dubai, United Arab Emirates. With a total height of 829.8 m (2,722 ft, just over half a mile) and a roof height (excluding antenna, but including a 244 m spire) of 828 m (2,717 ft), the Burj Khalifa has been the tallest structure and building in the world since its topping out in 2009, supplanting Taipei 101, the previous holder of that status.\r\n                &lt;/p&gt;\r\n                &lt;p class=&quot;desc&quot;&gt;\r\n                    Construction of the Burj Khalifa began in 2004, with the exterior completed five years later in 2009. The primary structure is reinforced concrete and some of the structural steel for the building originated from the Palace of the Republic in East Berlin, the former East German parliament. The building was opened in 2010 as part of a new development called Downtown Dubai. It is designed to be the centrepiece of large-scale, mixed-use development.\r\n                    The decision to construct the building is based on the government  ', 1),
(11, 'shanghai', '\r\n<body>\r\n    <div id=\"con\">\r\n        <div id=\"content\"> \r\n\r\n            <div class=\"containter\">\r\n                <h2 class=\"title_khalif\">Shanghai Tower</h2>\r\n                <div class=\"topleft\">\r\n                    <form action=\"index.html\">\r\n                        <div class=\"dropdown\">\r\n                            <button class=\"dropbtn\">More info</button>\r\n                            <div class=\"dropdown-content\">\r\n                                <a href=\"?idp=\">Main Page</a>\r\n                                <a href=\"?idp=khalifa\">Burj Khalifa</a>\r\n                                <a href=\"?idp=al_bait\">Abraj Al-Bait Clock Tower</a>\r\n                                <a href=\"?idp=finance_centre\">Ping An International Finance Centr</a>\r\n                                <a href=\"?idp=world_tower\">Lotte World Tower</a>\r\n                                <a href=\"?idp=videos\">Drone footage</a>\r\n                            </div>\r\n                        </div>\r\n                    </form>\r\n                </div>\r\n            </div>\r\n            \r\n        \r\n            <div style=\"height:auto; text-align:justify;\">\r\n                <div class=\"left_side\" style=\"margin-right:10px;\">\r\n                    <img src=\"resources/160px-Shanghai_Tower_2015.jpg\" style=\"float: left; margin-left: 30px;\">\r\n                </div>\r\n                <div class=\"right_side\" style=\"margin-left:10px;\">\r\n                    <img src=\"resources/shanghai-tower.jpg\" style=\"float: right; margin-right: 250px\">\r\n                </div>\r\n                <p class=\"desc\">\r\n                    Shanghai Tower is a 128-story, 632-meter-tall (2,073 ft) megatall skyscraper in Lujiazui, Pudong, Shanghai. It is the world\'s second-tallest building by height to architectural top and it shares the record (along with the Ping An Finance Center) of having the world\'s highest observation deck within a building or structure at 562 m. It had the world\'s second-fastest elevators at a top speed of 20.5 meters per second (74 km/h; 46 mph) until 2017, when it was surpassed by the Guangzhou CTF Finance Center, with its top speed of 21 meters per second (76 km/h; 47 mph). Designed by international design firm Gensler and owned by the Shanghai Municipal Government, it is the tallest of the world\'s first triple-adjacent supertall buildings in Pudong, the other two being the Jin Mao Tower and the Shanghai World Financial Center. Its tiered construction, designed for high energy efficiency, provides nine separate zones divided between office, retail and leisure use.\r\n                </p>\r\n                <p class=\"desc\">\r\n                    Construction work on the tower began in November 2008 and topped out on 3 August 2013. The exterior was completed in summer 2015, and work was considered complete in September 2014. Although the building was originally scheduled to open to the public in November 2014, the actual public-use date slipped considerably. The observation deck was opened to visitors in July 2016; the period from July through September 2018 was termed a \"test run\" or \"commissioning\" period. Since April 26, 2017, the sightseeing deck on the 118th floor has been open to the public. Since its opening, the tower has had significant maintenance issues and remains largely unoccupied.\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>    \r\n</body>\r\n', 1),
(12, 'videos1111', ' &lt;body&gt;\r\n	&lt;div class=&quot;topleft&quot;&gt;\r\n		&lt;div class=&quot;dropdown&quot;&gt;\r\n			&lt;button class=&quot;dropbtn&quot;&gt;More info&lt;/button&gt;\r\n			&lt;div class=&quot;dropdown-content&quot;&gt;\r\n				&lt;a href=&quot;?idp=&quot;&gt;Main Page&lt;/a&gt;\r\n				&lt;a href=&quot;?idp=khalifa&quot;&gt;Burj Khalifa&lt;/a&gt;\r\n				&lt;a href=&quot;?idp=shanghai&quot;&gt;Shanghai Tower&lt;/a&gt;\r\n				&lt;a href=&quot;?idp=al_bait&quot;&gt;Abraj Al-Bait Clock Tower&lt;/a&gt;\r\n				&lt;a href=&quot;?idp=finance_centre&quot;&gt;Ping An International Finance Centr&lt;/a&gt;\r\n				&lt;a href=&quot;?idp=world_tower&quot;&gt;Lotte World Tower&lt;/a&gt;\r\n			&lt;/div&gt;\r\n		&lt;/div&gt;\r\n	&lt;/div&gt;\r\n\r\n	&lt;div class=&quot;containter&quot;&gt;\r\n		&lt;div class=&quot;containter&quot; style=&quot;margin-top: 50px;&quot; &gt;\r\n			&lt;h1&gt;Burj Khalifa Drone Footage&lt;/h1&gt;\r\n			&lt;iframe width=&quot;560&quot; height=&quot;315&quot; src=&quot;https://www.youtube.com/embed/4LuBVXWpDss&quot; title=&quot;YouTube video player&quot; frameborder=&quot;0&quot; allow=&quot;accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture&quot; allowfullscreen&gt;&lt;/iframe&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;container&quot; style=&quot;margin-top: 25px;&quot; &gt;\r\n			&lt;h1 &gt;Shanghai Tower Drone Footage&lt;/h1&gt;			\r\n			&lt;iframe width=&quot;560&quot; height=&quot;315&quot; src=&quot;https://www.youtube.com/embed/5XEtBHYUPg4&quot; title=&quot;YouTube video player&quot; frameborder=&quot;0&quot; allow=&quot;accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture&quot; allowfullscreen&gt;&lt;/iframe&gt;\r\n		&lt;/div&gt;\r\n		&lt;div class=&quot;container&quot; style=&quot;margin-top: 25x;&quot; &gt;\r\n			&lt;h1&gt;Lotte World Tower Drone Footage&lt;/h1&gt;\r\n			&lt;iframe width=&quot;560&quot; height=&quot;315&quot; src=&quot;https://www.youtube.com/embed/15O4lVkPVAk&quot; title=&quot;YouTube video player&quot; frameborder=&quot;0&quot; allow=&quot;accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture&quot; allowfullscreen&gt;&lt;/iframe&gt;\r\n		&lt;/div&gt;\r\n	&lt;/div&gt;\r\n&lt;/body&gt;\r\n  ', 1);

